import React from 'react';
import {useDispatch, useSelector} from 'react-redux';
import {eliminarUsuarioAction, obtieneUsuarioEliminarAction} from '../../actions/userAction';
const ListadoUsuarios = ({usuario, count}) => {

   const dispatch = useDispatch();
    const {_id, nombre, creado, email} = usuario;
    const eliminaruaurio = (usuario) => dispatch( eliminarUsuarioAction(usuario) );
    // const obteniendoUsuarioEliminar = (usuario) => dispatch( obtieneUsuarioEliminarAction(usuario) );

    const eliminarUsuario = (usuario)=>{

        eliminaruaurio(usuario);
        

    }


    return ( 

        <tr>
            <th scope="row">{count}</th>
            <td>{nombre}</td>
            <td>{email}</td>
            <td>{creado}</td>
            <td>
                <button className="btn btn-sm btn-success">Editar</button>                
            </td>
            <td>
                <button 
                onClick={e=>eliminarUsuario(usuario)}
                className="btn btn-sm btn-danger">Eliminar</button>
            </td>
        </tr>

     );
}
 
export default ListadoUsuarios;
